import React from 'react';
import Link from 'next/link';
import styled from 'styled-components';

const Wrapper = styled.section`
  padding: 4em;
  background: papayawhip;
`;

function Navbar() {
  return (
    <>
      <Wrapper>
        <div className="brand">
          <img src="/images/Logo.png" alt="my image" />
        </div>
        <menu>
          <Link href="/">
            <a>Home</a>
          </Link>
          <Link href="/about">
            <a>About</a>
          </Link>
        </menu>
      </Wrapper>
    </>
  )
}

export default Navbar
